import React, {Component} from 'react'

export default class BlogC extends Component{
    render(){
        return(
        <div className="row ">
        <video controls className= "vcenter" style={{textAlign: 'center', display: 'block', margin: '0 auto'}} autoplay loop width="80%" height="100%">
        <source src="img/stay-tuned.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
        </div>
        )
    }
}
